import {
  Checkbox,
  Container,
  FormControl,
  FormControlLabel,
  TextField,
  Typography,
} from "@mui/material";
import { Box, Stack } from "@mui/system";
import React from "react";

const BrandFilter = () => {
  // brands data structure
  const brands1 = [
    { id: "0a", brandName: "puma" },
    { id: "0b", brandName: "adiddas" },
    { id: "0c", brandName: "wildcraft" },
    { id: "0d", brandName: "levis" },
    { id: "0e", brandName: "celio" },
  ];
  return (
    <Container>
      <Stack maxWidth={"20rem"}>
        <Typography variant="h3">Brand Filter</Typography>
        <TextField
          placeholder="Enter A Brand Name"
          label="Brand name"
          variant="standard"
        />
        <FormControl>
          {brands1.map((item) => {
            <FormControlLabel label={item.brandName} control={<Checkbox />} />;
            return;
          })}
        </FormControl>
      </Stack>
    </Container>
  );
};

export default BrandFilter;
